VALUES ('3434970000024', 'Corse Sartene AOP, rosé', 'FIUMICICOLI Notre vignoble, d\'une superficie de 73 hectares, est situé au cœur d\'une des premières régions viticoles de Corse, SARTENE. Le cépage traditionnel Sciacarello trouve dans ce terroir sa pleine expression. Nos méthodes de culture à l\'ancienne (labours, décavaillonnage...) respectueuses de sont l\'environnement et certifiées en Agriculture Biologique. Ellef garantissent à nos raisins une qualité indispensable a l\'élaboration de grands vins. Les nombreuses médailles obtenues notamment au Concours Général Agricole de Paris sont venues récompenser nos efforts qualitatifs, donnant à notre vignoble ses lettres de noblesse. rosés rempliront vos verres de toutes les senteurs de l\'Ile des nuances minérales typiques de notre terroir, ils s\'expriment pleinement la année. ROSÉ Vin Biologique', '', '0', '0', '0', '0', '0', '0', '0', '0', '', '1');

